  //   <div className="about__background">
  //     <ReactBrush height={window.innerHeight} width={window.innerWidth} />
  //   </div>
  // </div>
  return (
    <div>
      {" "}
      <Wrapper>
        <p>Simple customization of the brushed area</p>
        <ReactBrush
          height={200}
          width={400}
          style={{ border: "solid 1px black" }}
          brushedArea={
            <BrushedArea
              style={{
                fill: "transparent",
                stroke: "red",
                strokeWidth: "2px",
                opacity: 1.0
              }}
            />
          }
        />
      </Wrapper>
    </div>
  );
};

export default about;
